import { ArrowBackOutlined } from "@material-ui/icons";
import "./watch.scss";

export default function Watch() {
  return (
    <div className="watch">
      <div className="back">
        <ArrowBackOutlined />
        Home
      </div>
      <video
        className="video"
        autoPlay
        progress="'true'"
        controls
        src="http://techslides.com/demos/sample-videos/small.webm"
      />
    </div>
  );
}
